import Vue from 'vue';
import App from './App.vue';
import VueRouter from 'vue-router';
import Home from './Page/Home';
import About from './Page/About';

Vue.Use(VueRouter);

const routes = [
    {
        path:'/',
        name:'home',
        component: HomePage
    },
    {
        path:'/about',
        name:'about',
        component: AboutPage
    },
]

const router = new VueRouter({
    mode:"history",
    routes,
})

new Vue({
    router,
  render: (h) => h(App),
}).$mount('#app');
